import React from 'react';
import './App.css';
// Importujemo Link i BrowserRouter (opcionalno preimenovan u Router za čistoću)
import { Link, BrowserRouter as Router } from 'react-router-dom';

function App() {
  return (
    <Router> {/* Omogućuje ruting unutar aplikacije */}
      <div className="App">
        <header className="App-header">
          <h1>Aplikacija za lov</h1>
          <div className="Menu">
            {/* Zamijenite Button komponente s Link komponentama za navigaciju */}
            <Link to="/evidencija-lovaca" className="Button">EVIDENCIJA LOVACA</Link>
            <Link to="/raspored-aktivnosti-i-lova" className="Button">RASPORED AKTIVNOSTI I LOVA</Link>
            <Link to="/evidencija-prisutnosti-na-lovni-dan" className="Button">EVIDENCIJA PRISUTNOSTI NA LOVNI DAN</Link>
            <Link to="/unos-divljaci" className="Button">UNOS DIVLJAČI</Link>
            <Link to="/unos-odstrijelene-divljaci" className="Button">UNOS ODSTRIJELENE DIVLJAČI</Link>
            <Link to="/bodovi" className="Button">BODOVI</Link>
            {/* Primer korišćenja style objekta unutar Link komponente */}
            <Link to="/registracija" className="submit-btn register-btn" style={{ textDecoration: 'none' }}>Registracija</Link>
          </div>
        </header>
      </div>
    </Router>
  );
}

// Budući da sada koristimo Link komponente, Button komponenta možda više nije potrebna.
// Ako i dalje želite koristiti Button komponentu unutar Link, trebate prilagoditi njenu implementaciju.

export default App;
